import React, { Component } from 'react'
import Skeleton_Loading from '../pages/Skeleton_Profile'

export class Loading extends Component {
  render() {
    return (
      <>
        <div>
          <Skeleton_Loading />
        </div>
      </>
    )
  }
}

export default Loading
